import {makeStyles} from '@material-ui/core/styles'

const styles = makeStyles((theme) =>({
    navBar:{
        backgroundColor:'#21253c',
    },
    navBarBtn:{
        fontSize:17,
        color: '#fe4661',
    }
}))

export default styles;
